class App extends Component {
    render(){
        return(
            <div>Hello from App
            <h2>What Should U DO?</h2>
            <input className="form-control" type="text" placeholder="Enter What You Think....?"/>
            <input className="form-control" type="datetime-local" placeholder="Enter What You Think....?"/>
            <button className="btn btn-primary">Add Reminder</button>
            </div>
        )
    }
}
export default App;
